INSERT INTO `Configuracion` VALUES ('MODO_AFECTACION_CAJA','2','Parametro que indica como afectar los valores de caja, 0 no afecta, 1 afectan los totales de documentos, 2 afectan los medios de pago.'),('MODO_ARTICULO','1','Parametro que indica la modalidad de uso del codigo de articulo, 0 es alfanumerico, 1 es numerico.'),('MODO_IMPRESION_A4','1','Parametro que indica si la hoja se toma como A4 a pesar de las configuraciones pre establecidas.'),('MULTI_EMPRESA','0','Parametro que indica si se usa multiempresa, 1 - sí, 0 - no.'),('TIPO_CIERRE_LIQUIDACION','1','Parametro que indica como se cierran las liquidaciones. 0 - Se cierran al precionar boton de cierre. 1 - Se cierran al precionar boton de cierre y pide autorizacion. 2 - Se abre la ventana de declaracion de valores para poder cerrarse, requiere autorización.'),('VERSION_BD','43','Muestra la verisión de la base de datos. Este dato se utiliza para indicarle a la aplicación la versión de la base de datos, y que la misma realice las actualizaciones necesarias.');
