  CONSTRAINT `fk_DocumentoExiste` FOREIGN KEY (`codigoDocumento`, `codigoTipoDocumento`) REFERENCES `Documentos` (`codigoDocumento`, `codigoTipoDocumento`) ON DELETE NO ACTION ON UPDATE NO ACTION
